eval("module.exports = \"<div class=\\\"row\\\"> <div class=\\\"col-md-12 col-lg-6\\\"> <nb-card size=\\\"small\\\"> <nb-tabset> <nb-tab tabTitle=\\\"Simple Tab #1\\\"> <p>In 1975, the first general purpose home automation network technology, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/X10_(industry_standard)\\\" title=\\\"X10 (industry standard)\\\">X10</a>, was developed. It is a communication protocol for electronic devices. It primarily uses <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Electric_power_transmission\\\" title=\\\"Electric power transmission\\\">electric power transmission</a> wiring for signalling and control, where the signals involve brief <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Radio_frequency\\\" title=\\\"Radio frequency\\\">radio frequency</a> bursts of <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Digital_data\\\" title=\\\"Digital data\\\">digital data</a>, and remains the most widely available.<sup id=\\\"cite_ref-8\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-8\\\">[8]</a></sup> By 1978, X10 products included a 16 channel command console, a lamp module, and an appliance module. Soon after came the wall switch module and the first X10 timer.</p> </nb-tab> <nb-tab tabTitle=\\\"Simple Tab #2\\\"> <span>Content #2</span> </nb-tab> <nb-tab tabTitle=\\\"Simple Tab #3\\\"> <span>Content #3</span> </nb-tab> </nb-tabset> </nb-card> </div> <div class=\\\"col-md-6\\\"> <nb-card size=\\\"small\\\"> <nb-tabset fullWidth> <nb-tab tabTitle=\\\"Full width tab #1\\\"> <p><b>Home automation</b> or <b>smart home</b><sup id=\\\"cite_ref-Smart_Home_1-0\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-Smart_Home-1\\\">[1]</a></sup> (also known as <b>domotics</b><sup id=\\\"cite_ref-t3_2-0\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-t3-2\\\">[2]</a></sup>) is <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Building_automation\\\" title=\\\"Building automation\\\">building automation</a> for the home. It involves the control and automation of lighting, heating (such as <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Smart_thermostat\\\" title=\\\"Smart thermostat\\\">smart thermostats</a>), ventilation, air conditioning (<a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/HVAC\\\" title=\\\"HVAC\\\">HVAC</a>), and security, as well as <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Home_appliance\\\" title=\\\"Home appliance\\\">home appliances</a> such as washer/dryers, ovens or refrigerators/freezers. <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Wi-Fi\\\" title=\\\"Wi-Fi\\\">Wi-Fi</a> is often used for remote monitoring and control. Home devices, when remotely monitored and controlled via the Internet, are an important constituent of the <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Internet_of_Things\\\" class=\\\"mw-redirect\\\" title=\\\"Internet of Things\\\">Internet of Things</a>. Modern systems generally consist of switches and sensors connected to a central hub sometimes called a \\\"gateway\\\" from which the system is controlled with a <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/User_interface\\\" title=\\\"User interface\\\">user interface</a> that is interacted either with a wall-mounted terminal, mobile phone software, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Tablet_computer\\\" title=\\\"Tablet computer\\\">tablet computer</a> or a web interface, often but not always via Internet cloud services.</p> <p>While there are many competing vendors, there are very few worldwide accepted industry standards and the smart home space is heavily fragmented.<sup id=\\\"cite_ref-3\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-3\\\">[3]</a></sup> Popular <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Communications_protocol\\\" title=\\\"Communications protocol\\\">communications protocol</a> for products include <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/X10_(industry_standard)\\\" title=\\\"X10 (industry standard)\\\">X10</a>, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Ethernet\\\" title=\\\"Ethernet\\\">Ethernet</a>, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/RS-485\\\" title=\\\"RS-485\\\">RS-485</a>, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/6LoWPAN\\\" title=\\\"6LoWPAN\\\">6LoWPAN</a>, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Bluetooth_low_energy\\\" class=\\\"mw-redirect\\\" title=\\\"Bluetooth low energy\\\">Bluetooth LE (BLE)</a>, <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/ZigBee\\\" class=\\\"mw-redirect\\\" title=\\\"ZigBee\\\">ZigBee</a> and <a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org/wiki/Z-Wave\\\" title=\\\"Z-Wave\\\">Z-Wave</a>, or other proprietary protocols all of which are incompatible with each other.<sup id=\\\"cite_ref-crhomephone_4-0\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-crhomephone-4\\\">[4]</a></sup> Manufacturers often prevent independent implementations by withholding documentation and by litigation.<sup id=\\\"cite_ref-5\\\" class=\\\"reference\\\"><a target=\\\"_blank\\\" href=\\\"https://en.wikipedia.org#cite_note-5\\\">[5]</a></sup></p> </nb-tab> <nb-tab tabTitle=\\\"Full width tab #2\\\"> <span>Content #2</span> </nb-tab> <nb-tab tabTitle=\\\"Full width tab #3\\\"> <span>Content #3</span> </nb-tab> </nb-tabset> </nb-card> </div> <div class=\\\"col-md-6\\\"> <nb-card size=\\\"small\\\"> <nb-route-tabset [tabs]=\\\"tabs\\\"></nb-route-tabset> </nb-card> </div> </div> \";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/main/webapp/app/ngx-admin/pages/extra-components/tabs/tabs.component.html\n");

